function readlines(html_intermedia,cont_line){
	let html='';
	$(".week_item").each(function() {	
		let cont = $(this).data('cont');
		html='<div class="week_item row week' + cont + '" id="week' + cont + '" data-cont="'+cont+'">' +
		$(this).html()+'</div>';
		$('#weeks').append(html);
		if(cont_line===cont){
			$('#weeks').append(html_intermedia);
		}
	});
}
