	function activarCombosNivelContenido(){
		$('#divLevel').hide();
		$('#divnLevel').hide();
		$('#divbLevel').hide();
		$('#divcLevel').hide();
		$('#divContent').hide();
		$('#divnContent').hide();
		$('#divbContent').hide();
		$('#divcContent').hide();
		if($('#sport_select').val()==4){//Triatlón
			$('#divnLevel').show();
			$('#divbLevel').show();
			$('#divcLevel').show();
			$('#divnContent').show();
			$('#divbContent').show();
			$('#divcContent').show();
		}
		else if($('#sport_select').val()==5){//duatlón
			$('#divbLevel').show();
			$('#divcLevel').show();
			$('#divbContent').show();
			$('#divcContent').show();
		}
		else if($('#sport_select').val()==6){//Acuatlón
			$('#divnLevel').show();
			$('#divcLevel').show();
			$('#divnContent').show();
			$('#divcContent').show();
		}
		else{
			$('#divLevel').show();
			$('#divContent').show();
		}
	}
